                                                        <label className="form-label">Email Id</label>
                                                        <input type="email" className="form-control" id="exampleInputPassword1" placeholder="Email Id" />
                                                    </div>
                                                    <div className="mb-4">
                                                        <label className="form-label">Message</label>
                                                        <textarea className="form-control" placeholder="Write Your Message" id="floatingTextarea2"></textarea>
                                                    </div>
                                                    <button type="submit" className="btntheme">Book Appointment</button>
                                                </form>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            {
                                open ?
                                    <MapProject closeModal={() => closeModal()} openModal={() => openModal()} show={open} />
                                    :
                                    ''
                            }
                        </div>
                    </>
                    : ''}
              </>
                )
                }
        </>
    );
}

export default ProjectDetail;
